INSERT INTO `valh_postmeta` VALUES("273", "75", "prices", "<p><strong>Standard Detail:</strong><br /> Hand wash exterior, vacuum interior and trunk, wipe down dashboard, wheels, wheel wells and tires degreased and cleaned, windows cleaned inside and out, tires dressed and spray wax<br /> <strong>Cars - $35  SUV\'s - $45</strong></p><p><strong>Special Detail:</strong><br /> Hand wash exterior, vacuum interior and trunk, wipe down dashboard, wheels, wheel wells and tires degreased and cleaned, windows cleaned inside and out, tires dressed and carefully hand waxed exterior<br /> <strong>Cars - $60 SUV\'s - $80</strong></p><p><strong>Interior Detail:</strong><br /> Hand wash exterior, wheels, wheel wells and tires degreased and cleaned, windows cleaned inside and out, tires dressed, shampoo interior carpets and mats, clean windows, clean and condition leather and vinyl, shampoo sealing, vacuum interior and trunk<br /> <strong>Starting at Cars - $160 SUV\'s - $180 ** extra based on size and condition of vehicle**</strong></p><p><strong>Exterior Detail:</strong><br /> Hand wash exterior, wheel, wheel wells and tires degreased and cleaned, clean all door jams, hood jam and trunk jam, clay exterior paint, compound out scratches, polish paint, hand wax exterior, treat all exterior trim on vehicle, clean windows inside and out<br /> <strong>Starting at Cars - $160 SUV\'s - $180 ** extra based on size and condition of vehicle**</strong></p><p><strong>Super Detail:</strong><br /> Includes both the Interior Detail and Exterior Detail<br /> <strong>Starting at Cars - $240 SUV\'s - $280 ** extra based on size and condition of vehicle**</strong></p><p><strong>New Car Detail:</strong><br /> Hand wash exterior, clay exterior, polish exterior paint, wax exterior paint, blow out and vacuum interior, treat leather, clean and dress tires and wheels<br /> <strong>Starting at $180 **extra based on size and condition of vehicle**</strong></p>");
