INSERT INTO `valh_postmeta` VALUES("308", "79", "prices", "<p><strong>Exterior Wash:</strong><br /> Includes hand wash, clean windows, clean wheels and shine tires<br /> <strong>Must quote in person</strong></p><p><strong>Exterior Detail:</strong><br /> Includes hand wash, compound scratches, polish and wax, clean windows, polish all metal surfaces, clean and shine tires.<br /> <strong>Must quote in person</strong></p><p><strong>Interior Detail:</strong><br /> Includes shampoo interior rugs and carpets, clean all compartments and rooms, clean windows, and polish all metal surfaces<br /> <strong>Must quote in person</strong></p><p><strong>Trailer wash:</strong><br /> Includes hand wash exterior, clean wheels and tires and shine tires<br /> <strong>$10 per foot</strong></p><p><strong>Trailer detail:</strong><br /> Includes hand wash, polish and wax exterior, polish all metal surfaces, clean and shine wheels and tires<br /> <strong>$15 per foot</strong></p>");
