INSERT INTO `valh_postmeta` VALUES("327", "82", "prices", "<p><strong>Boat Washing</strong><br /> Includes washing entire top side of boat and hull, cleaning all windows, and drying boat down<br /> <strong>$10 per foot</strong></p><p><strong>Top Side Detailing</strong><br /> Includes washing the entire top side from the rub line up, compound out an scratches, polish and wax where applicable, clean all live wells, clean all windows, polish all metal surfaces and clean all nonskid surfaces.<br /> <strong>$15 per foot</strong></p><p><strong>Hull Detailing:</strong><br /> Includes washing the hull from the rub line down to the paint line, compound out any scratches, polish and paste wax<br /> <strong>$12 per foot</strong></p>");
