INSERT INTO `valh_posts` VALUES("10", "2", "2015-06-12 17:59:08", "2015-06-12 17:59:08", "<h1>Valhalla Detailing</h1>\r\n<p>Has been reconditioning vehicles in Monmouth County New Jersey for over fifteen years. We started in Little Silver, NJ with our first detail shop in 2000. Since then, we have expanded throughout New Jersey with locations in Ocean Township and West Long Branch. We now proudly serve the following areas: Little Silver, Rumson, Red Bank, Monmouth Beach, Colts Neck, Deal, Shrewsbury</p>\r\n<p>Over the years, a full line of services such as mobile detailing, dealership fleet detailing, window tinting, headlamp restoration, wheel repair, wet sanding and interior odor removal have been added. Valhalla Detailing has quickly risen to the top of the list of New Jerseys trusted vehicle reconditioning and detailing experts.</p>\r\n<p>Founded and operated by Guy H. DiTommaso, a Little Silver native, Valhalla Detailing is continuing to grow while still producing excellent, unmatched results. We take pride in offering superior results with concierge service.</p>\r\n<img src=\"http://valhalladetailing.com/wp-content/uploads/2015/06/guy_03.jpg\" alt=\"Guy\" width=\"265\" height=\"327\" class=\"aligncenter size-full wp-image-15\" />", "About Us", "", "publish", "closed", "closed", "", "about-us", "", "", "2015-07-24 19:44:39", "2015-07-24 19:44:39", "", "0", "http://valhalladetailing.com/?page_id=10", "0", "page", "", "0");
